import React from 'react';
import './CatGalleryItem.css';


class CatGalleryItem extends React.Component{

	render(){
		return(

				<div className="CatGalleryItem">
					<p>Hello</p>
					<p>HEY</p>
				</div>
			);
	}
}


export default CatGalleryItem;
